const std = @import("std");
const image = @import("image.zig");

pub const Tex2 = packed struct {
    u: f32,
    v: f32,

    const SimdVec2 = @Vector(2, f32);
};

pub const Texture = struct {
    material: []const u32,
    width: usize,
    height: usize,

    allocator: ?std.mem.Allocator,
    image: ?*image.SDLImage,

    pub fn init(width: usize, height: usize, material: []const u32) Texture {
        return Texture{
            .material = material,
            .width = width,
            .height = height,
        };
    }

    pub fn deinit(self: *Texture) void {
        if (self.image) |img| {
            img.deinit();
        }
        if (self.allocator) |alloc| {
            alloc.destroy(self.image.?);
        }
    }

    pub fn get_texel(self: *const Texture, u: f32, v: f32) u32 {
        const x: usize = @abs(@as(i64, @intFromFloat(u * self.width_f32())));
        const y: usize = @abs(@as(i64, @intFromFloat(v * self.height_f32())));

        const index = std.math.clamp(y * self.width + x, 0, (self.width * self.height) - 1);
        return self.material[index];
    }

    pub inline fn width_f32(self: *const Texture) f32 {
        return @floatFromInt(self.width);
    }

    pub inline fn height_f32(self: *const Texture) f32 {
        return @floatFromInt(self.height);
    }
};

pub fn load_png(allocator: std.mem.Allocator, path: []const u8) !*Texture {
    const png = try image.SDLImage.load(allocator, path);

    var t = try allocator.create(Texture);
    t.allocator = allocator;
    t.material = png.pixels;
    t.width = png.width;
    t.height = png.height;
    t.image = png;
    return t;
}

